import React from 'react';
import './film.css';

const Film = ({title,title_long,cover}) => {
    return (
        <div className='col'>
            <div>{title}</div>
            <h1>{title_long}</h1>
            <div>
                <img src={cover} className='img'/>
            </div>
        </div>
    );
};

export default Film;
